import React from 'react'
import Navbar from './Navbar'
import { Box, Grid } from "@material-ui/core"
import { makeStyles, useTheme } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import IconButton from '@material-ui/core/IconButton';
import Typography from '@material-ui/core/Typography';
import { CenterFocusStrong } from '@material-ui/icons';

const useStyles = makeStyles((theme) => ({
    root: {
      display: 'flex',
    },
    details: {
      display: 'flex',
      flexDirection: 'column',
    },
    content: {
      flex: '1 0 auto',
    },
    cover: {
      width: 151,
    },
    heading:{
        color: "tomato",
        padding: "3rem 0",
        textTransform: "uppercase"
    }
  }));

const Portfolio = () => {
    const classes = useStyles();
    const theme = useTheme();
    return (
        <Box component="div">
            <Navbar />
            <Grid container justify="center" alignItems="center">
               <Grid item xs={12} sm={8} md={6}>
                <Typography className={classes.heading} variant="h4" align="center">Technical Skills</Typography>
               <Card className={classes.root}>
                    <div className={classes.details}>
                    <CardContent className={classes.content}>
                        <Typography component="h5" variant="h5">
                        Live From Space
                        </Typography>
                        <Typography variant="subtitle1" color="textSecondary">
                        Mac Miller
                        </Typography>
                    </CardContent>
                    </div>
                    <CardMedia className={classes.cover} image="/static/images/cards/live-from-space.jpg" title="Live from space album cover" />
                </Card>
                </Grid>
            </Grid>
        </Box>
    )
}

export default Portfolio
